  false,\n\t\"url\": null,\n\t\"notes\": \"The Oregon Department of Geology & Mineral
  Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
  topographic LiDAR data for Lake Billy Chinook (from the resevoir edge to the surrounding
  canyon rim). The total area of this collection, including a 50 meter project buffer,
  is approximately 46 square miles (29,228 acres). This LiDAR data set was collected
  on August 14th and 15th, 2008 and encompasses a portion of Jefferson County. This
  data set consists of bare earth, water and unclassified points. There are approximately
  7.8 points per square meter over terrestrial surfaces. In some areas of heavy vegetation
  or forest cover, there may be relatively few ground points in the LiDAR data. Elevation
  values for open water surfaces are not valid elevation values because few LiDAR
  points are returned from water surfaces. LiDAR intensity values were also collected.\",\n\t\"owner_org\":
